import React from 'react';

import '../styles/Foundations2.css';

import manual from '../images/manual.png';
import gold from '../images/gold.png';


const Foundations2 = (props) => {
    return (
        <React.Fragment>
            <div className="section foundation-landing-section">
                <div className="manual-container">
                    <img id="manual" src={manual}></img>
                    <img id="gold" src={gold}></img>
                </div>
            </div>
            <div className="section feature1-section">
                <h1>About Us</h1>
            </div>
            <div className="section feature2-section">
                <h1>About Us</h1>
            </div>
            <div className="section day1-section">
                <h1>About Us</h1>
            </div>
            <div className="section day2-section">
                <h1>About Us</h1>
            </div>
        </React.Fragment>

    )
}

export default Foundations2;
